项目配置文件: ./Cargo.toml 文件Cargo.toml是由用户编写的描述项目共享篋依赖关系。而文件Cargo.lock包含有关共享软件篋的依赖项的确切信息。它是由Cargo工具自动生成和维护的，不应手动对其进行编辑。 项目配置文件: ./Cargo.toml [package]
name = "hello_exercism"
version = "0.3.5"
authors = ["cnruby <gudao.luo@gmail.com>"]
edition = "2018"
readme = "README.md"
license = "MIT OR Apache-2.0"
repository = "https://github.com/cnruby/learn-rust-by-crates/tree/master/hello-world"
homepage = "https://crates.io/crates/hello_exercism"
documentation = "https://cnruby.github.io/learn-rust-by-crates/hello-world/hello_exercism/"
description = "how to create an own crate" # See more keys and their definitions at https://doc.rust-lang.org/cargo/reference/manifest.html [dependencies]
i_crate = { version = "0.3.3", package = "hello_exercism" } 在文件Cargo.toml里，最重要的一项是共享软件篋名称：name。这是使用该共享篋的入口名称。这里默认模块名称为hello_exercism。最常用的一节是共享篋依赖关系：[dependencies]。 程序文件lib.rs 程序文件lib.rs是共享篋的入口文件。这里它只有一个函数hello()，其功能就是返回一个类型为&str的字符串。可以把它看作为一个类型为&str的字符串与一个变量绑定。 每一个共享篋都有自己的入口模块名称，这里是hello_exercism，使用共享篋都要从这个名称开始，这里模块hello_exercism有自己的函数hello()。程序文件lib.rs可以使用关键词mod再定义模块名称，但是它们都是hello_exercism的子模块。 在Rust语言里，表达式和语句都可以作为一行代码。要是一行代码，最后没有分号就是表达式，而有分号就是语句。表达式只有作为函数的返回值。 在Rust语言里，存在一类关键词是修饰词关键词，不能独立使用它们，如关键词"pub"和“static”。 在Rust语言里，所有模块和函数都是私有的。要使得它们可公开访问的话，就需要使用修饰词关键词'pub'。 对于修饰词关键词'static'，Rust语言以与常量类似的方式提供了类似“全局变量”的功能。对每一个值只有一个实例，并且位于内存中的固定位置。 Rust文件: src/lib.rs pub fn hello() -> &'static str { "Hello, World!"
} 函数hello()从意义上类似于使用关键词let语句，如下所示： Rust文件: examples/main.rs fn main () { let _hello :&'static str = "Hello, World!";
} 单元测试文件u_hello.rs 测试文件名称命名是由用户自己确定的。 大多数单元测试都带有注解'#[cfg(test)]'的测试模块。每一个测试函数注解带有'#[test]'标记。每个测试函数都是单独地调用正在开发的共享软件篋进行运行的。因此Cargo工具将共享软件篋纳入到每个测试函数的范围里。 Rust文件: tests/u_hello.rs #[cfg(test)]
mod tests { #[test] fn it_works_u() { assert_eq!("Hello, World!", hello_exercism::hello()); }
} 集成测试文件i_hello.rs 集成测试不需要使用注释'#[cfg(test)]'来注释任何测试代码。 Rust文件: tests/i_hello.rs use i_crate; #[test]
fn it_works_i() { assert_eq!("Hello, World!", i_crate::hello());
} 单元实例文件u_hello.rs 这是可执行的Rust程序。 Rust文件: examples/u_hello.rs fn main () { println!("{}",hello_exercism::hello());
} 集成实例文件i_hello.rs Rust文件: examples/i_hello.rs use i_crate; fn main () { println!("{}",i_crate::hello());
}
